static void
print_hex(const char *text, const void *buf, size_t n)
{
  const unsigned char *p = buf;

  fputs(text, stdout);
  for (; n; n--, p++)
    printf("%02X", *p);
  putchar('\n');
}

static void
print_hex_skip_bytes(const char *text, const void *buf, size_t n, size_t offset)
{
  // printf("offset: %ld\n",offset);
  const unsigned char *p = buf;
  p += offset;

  fputs(text, stdout);
  for (; n; n--, p++)
    printf("%02X", *p);
  putchar('\n');
}

