uint8_t *bytesFrom64(uint64_t block)
{
  uint8_t *bytes = malloc((sizeof(uint8_t)) * 8);
  bytes[7] = (block & 0x00000000000000FFull) >> 0;
  bytes[6] = (block & 0x000000000000FF00ull) >> 8;
  bytes[5] = (block & 0x0000000000FF0000ull) >> 16;
  bytes[4] = (block & 0x00000000FF000000ull) >> 24;
  bytes[3] = (block & 0x000000FF00000000ull) >> 32;
  bytes[2] = (block & 0x0000FF0000000000ull) >> 40;
  bytes[1] = (block & 0x00FF000000000000ull) >> 48;
  bytes[0] = (block & 0xFF00000000000000ull) >> 56;
  return bytes;
}

uint8_t *bytesFromBlock(struct Block block)
{
  uint8_t *bytes = malloc((sizeof(uint8_t)) * 8);
  bytes[7] = (block.lsb & 0x000000FF) >> 0;
  bytes[6] = (block.lsb & 0x0000FF00) >> 8;
  bytes[5] = (block.lsb & 0x00FF0000) >> 16;
  bytes[4] = (block.lsb & 0xFF000000) >> 24;
  bytes[3] = (block.msb & 0x000000FF) >> 0;
  bytes[2] = (block.msb & 0x0000FF00) >> 8;
  bytes[1] = (block.msb & 0x00FF0000) >> 16;
  bytes[0] = (block.msb & 0xFF000000) >> 24;
  return bytes;
}

uint64_t b64FromBytes(uint8_t *bytes)
{
  uint64_t block;
  for (int i = 0; i < 8; i++)
    block = (block << 8) | bytes[i];
  return block;
}

struct Block blockFromBytes(uint8_t *bytes)
{
  struct Block block = {
      .msb = 0,
      .lsb = 0};
  for (int i = 0; i < 8; i++)
  {
    if (i < 4)
      block.msb = (block.msb << 8) | bytes[i];
    else
      block.lsb = (block.lsb << 8) | bytes[i];
  }
  return block;
}

uint64_t xorBlock(uint64_t block, uint64_t val)
{
  return (block ^ val);
}

struct Block xorBlock2(struct Block block, struct Block val)
{
  struct Block result = {
      .msb = block.msb ^ val.msb,
      .lsb = block.lsb ^ val.lsb};
  return result;
}

void appendBytes(uint8_t *outbuf, int offset, uint8_t *bytes, int len)
{
  for (int i = 0; i < len; i++)
  {
    outbuf[i + offset] = bytes[i];
  }
}

void appendBytesInOffset(uint8_t *outbuf, int offset, uint8_t *bytes, int len, int inOffset)
{
  for (int i = 0; i < len; i++)
  {
    outbuf[i + offset] = bytes[i + inOffset];
  }
}

void appendBytes2(uint8_t *outbuf, int offset, char *bytes, int len)
{
  for (int i = 0; i < len; i++)
  {
    outbuf[i + offset] = bytes[i];
  }
}

