/*
Version no 	currently 1 	4 bytes
In-counter 	positive integer VI = VarInt 	1 - 9 bytes
list of inputs
Out-counter 	positive integer VI = VarInt 	1 - 9 bytes
list of outputs 	the outputs of the first transaction spend the mined bitcoins for the block 	<out-counter>-many outputs
lock_time 	if non-zero and sequence numbers are < 0xFFFFFFFF: block height or timestamp when transaction is final 	4 bytes
*/

#define VAR_INT_2BYTE 0xFD
#define VAR_INT_4BYTE 0xFE
#define VAR_INT_8BYTE 0xFF

struct TxOutput
{
  uint8_t value[8]; // 8 bytes
  size_t scriptLen; // parseVarInt
  uint8_t *script;  //
};

struct OutputArray
{
  size_t count;
  struct TxOutput *items;
};

struct TxInput
{
  uint8_t prevTxidLE[32]; // 32 bytes
  size_t voutIdx[4];      // 4 bytes
  size_t scriptLen;
  uint8_t *script;
  uint8_t sequence[4];
};

struct InputArray
{
  size_t count;
  struct TxInput *items;
};

struct BitcoinTx
{
  uint8_t version[4]; // 4 bytes
  struct InputArray vins;
  struct OutputArray vouts;
  uint8_t lockTime[4]; // 4 bytes usually 0xffffffff
  uint8_t *buf;
  size_t size;
};

size_t parseVarInt(uint8_t *p, size_t *dest)
{
  uint8_t varint = *p;
  size_t skip = 1;
  if (varint < VAR_INT_2BYTE)
  {
    *dest = varint;
    // print_hex("parseVarInt 1:",(p+1),1);
  }
  else if (varint == VAR_INT_2BYTE)
  {
    memcpy(dest, (p + 1), 2);
    // print_hex("parseVarInt 2:",(p+1),2);
    skip += 2;
  }
  else if (varint == VAR_INT_4BYTE)
  {
    memcpy(dest, (p + 1), 4);
    // print_hex("parseVarInt 4:",(p+1),4);
    skip += 4;
  }
  else if (varint == VAR_INT_8BYTE)
  {
    memcpy(dest, (p + 1), 8);
    // print_hex("parseVarInt 8:",(p+1),8);
    skip += 8;
  }
  return skip;
}

struct BitcoinTx parseTx(uint8_t *data, size_t dataLen)
{
  struct BitcoinTx tx = {
      .buf = data,
      .size = dataLen};

  int offset = 0;
  for (int i = 0; i < 4; i++)
    tx.version[i] = data[offset++];

  // print_hex("version: ", tx.version, 4);
  struct InputArray vins = {
      .count = 0,
  };
  size_t skip = parseVarInt(data, &vins.count);
  // printf("vinCount: %ld\n",vins.count);
  offset += skip;
  struct TxInput inputArray[vins.count];
  // Parse vins
  for (int i = 0; i < vins.count; i++)
  {
    struct TxInput vin = {
        .scriptLen = 0,
    };
    // uint8_t* prevTxidLE; // 32 bytes
    for (int j = 0; j < 32; j++)
      vin.prevTxidLE[j] = data[offset++];

    // print_hex("vin.prevTxidLE: ", vin.prevTxidLE, 32);
    // size_t* voutIdx; // 4 bytes
    for (int j = 0; j < 4; j++)
      vin.voutIdx[j] = data[offset++];

    // print_hex("vin.voutIdx: ", vin.voutIdx, 4);
    // size_t* scriptLen;
    skip = parseVarInt(data + offset, &vin.scriptLen);
    offset += skip;

    // printf("skip: %ld\n",skip);
    // printf("vin.scriptLen: %ld\n",vin.scriptLen);
    // uint8_t* script;
    vin.script = malloc(vin.scriptLen);
    for (int j = 0; j < vin.scriptLen; j++)
      vin.script[j] = data[offset++];

    // print_hex("vin.script: ", vin.script, vin.scriptLen);
    // uint8_t* sequence;
    for (int j = 0; j < 4; j++)
      vin.sequence[j] = data[offset++];

    // print_hex("vin.sequence: ", vin.sequence, 4);

    inputArray[i] = vin;
  }
  vins.items = inputArray;
  tx.vins = vins;
  struct OutputArray vouts = {
      .count = 0,
  };
  // uint8_t* voutCountBytes; // 1-9 bytes
  skip = parseVarInt(data + offset, &vouts.count);
  offset += skip;
  struct TxOutput outputArray[vouts.count];
  for (int i = 0; i < vouts.count; i++)
  {
    struct TxOutput vout = {
        .scriptLen = 0};
    for (int j = 0; j < 8; j++)
      vout.value[j] = data[offset++];

    // print_hex("vout.value: ", vout.value, 8);
    skip = parseVarInt(data + offset, &vout.scriptLen);
    offset += skip;
    // uint8_t* script;
    vout.script = malloc(vout.scriptLen);
    for (int j = 0; j < vout.scriptLen; j++)
    {
      vout.script[j] = data[offset++];
    }
    // print_hex("vout.script: ", vout.script, vout.scriptLen);
    outputArray[i] = vout;
  }
  vouts.items = outputArray;
  tx.vouts = vouts;
  // uint8_t* lockTime; // 4 bytes usually 0xffffffff
  for (int i = 0; i < 4; i++)
    tx.lockTime[i] = data[offset++];
  printf("TX vouts: %ld, vins: %ld\n", tx.vouts.count, tx.vins.count);
  return tx;
}

/*-- Macros to replace ctype ones to avoid locale problems. --*/
/* Note this isn't identical to a C locale isspace() without \f and
   \v, but works for the purposes used here. */
#define ascii_isspace(a) ((a) == ' ' || (a) == '\n' || (a) == '\r' || (a) == '\t')

/* Convert STRING consisting of hex characters into its binary
   representation and store that at BUFFER.  BUFFER needs to be of
   LENGTH bytes.  The function checks that the STRING will convert
   exactly to LENGTH bytes. The string is delimited by either end of
   string or a white space character.  The function returns -1 on
   error or the length of the parsed string.  */
int hex2bin(const char *string, void *buffer, size_t length)
{
  int i;
  const char *s = string;

  for (i = 0; i < length;)
  {
    if (!hexdigitp(s) || !hexdigitp(s + 1))
      return -1; /* Invalid hex digits. */
    ((unsigned char *)buffer)[i++] = xtoi_2(s);
    s += 2;
  }
  if (*s && (!isascii(*s) || !isspace(*s)))
    return -1; /* Not followed by Nul or white space.  */
  if (i != length)
    return -1; /* Not of expected length.  */
  if (*s)
    s++; /* Skip the delimiter. */
  return s - string;
}

