struct DataBuf
{
  size_t len;
  uint8_t *data;
};

struct DataBuf extractGpgFileFromP2FKHOutputs(struct BitcoinTx *tx)
{
  // From satoshi-downloader.py
  /*
    data = b''
    for txout in tx['vout'][0:-2]:
        for op in txout['scriptPubKey']['asm'].split(' '):
            if not op.startswith('OP_') and len(op) >= 40:
                data += unhexlify(op.encode('utf8'))

    length = struct.unpack('<L', data[0:4])[0]
    checksum = struct.unpack('<L', data[4:8])[0]
    data = data[8:8+length]
  */
  // We need to calculate the size to malloc so just overdo it
  size_t mallocCount = 0;
  for (int i = 0; i < tx->vouts.count - 2; i++)
  {
    mallocCount += tx->vouts.items[i].scriptLen;
  }
  size_t totalFileBytes = 0;
  uint8_t *data = malloc(mallocCount);
  for (int i = 0; i < tx->vouts.count - 2; i++)
  {
    struct TxOutput vout = tx->vouts.items[i];
    // if(i==0)print_hex("voutScript: ",vout.script,vout.scriptLen);
    int offset = 0;
    // int m = vout.script[offset++];
    // printf("M: %02X\n",m);
    offset++;
    int dataLen = vout.script[offset++];
    // printf("dataLen: %d\n",dataLen);
    for (int j = 0; j < dataLen; j++)
    {
      data[totalFileBytes + j] = vout.script[offset++];
    }
    totalFileBytes += dataLen;
    // print_hex_skip_bytes("writing:  ",vout.script+(offset-dataLen), dataLen, 0);
    // print_hex_skip_bytes("wrote:    ",data+(totalFileBytes-dataLen), dataLen, 0);
    dataLen = vout.script[offset++];
    // printf("dataLen: %d\n",dataLen);
    while (offset < vout.scriptLen && dataLen != 0x53 && dataLen != 0x52 && dataLen != 0x51)
    { // Multisig N (termination of script)
      for (int j = 0; j < dataLen; j++)
      {
        data[totalFileBytes + j] = vout.script[offset++];
      }
      totalFileBytes += dataLen;
      // print_hex_skip_bytes("writing:  ",vout.script+(offset-dataLen), dataLen, 0);
      // print_hex_skip_bytes("wrote:    ",data+(totalFileBytes-dataLen), dataLen, 0);

      dataLen = vout.script[offset++];
      // printf("dataLen: %d\n",dataLen);
    }
  }
  // Remove file length and checksum

  // length = struct.unpack('<L', data[0:4])[0]
  // checksum = struct.unpack('<L', data[4:8])[0]
  // data = data[8:8+length]
  size_t length = {0};
  memcpy(&length, &data[0], 4);
  // print_hex("lengthBytes: ",data,4);
  data = data + 4;
  unsigned long checksum = {0};
  memcpy(&checksum, &data[0], 4);
  // print_hex("crcBytes: ",data,4);
  data = data + 4;
  struct DataBuf result;
  result.data = data;
  result.len = length;
  print_hex("result: ", result.data, result.len);
  // printf("length: %ld\n",length);
  // printf("result.len: %ld\n",result.len);
  /*
    unsigned long crc;
    const unsigned char FAR *buf;
    uInt len;
  */
  unsigned long crc = crc32(checksum, data, length);
  printf("checksum: %ld\n", checksum);
  printf("crc: %ld\n", crc);
  return result;
}

int checkIfHexChar(char byte)
{
  if ((byte >= 48 && byte <= 57) || (byte >= 65 && byte <= 70) || (byte >= 97 && byte <= 102))
    return 1;
  return 0;
}
char *extract64HexStringFromData(uint8_t *data, size_t dataLen)
{
  /*
    ascii hex chars
    0-9: 48-> 57 (10)
    A-F: 65-> 70 (6)
    a-f: 97->102 (6)
  */
  // print_hex("data: ",data,dataLen);
  char *result = malloc(64);
  int found = 0;
  // Debug print
  // for(int i = 0; i<dataLen-64; i++){
  //     char currByte = data[i];
  //     printf("%c",currByte);
  // }
  // printf("\n");
  // found
  for (int i = 0; i < dataLen - 64; i++)
  {
    char currByte = data[i];
    int isHexChar = checkIfHexChar(currByte);
    int count = 0;
    if (isHexChar)
    {
      result[count++] = currByte;
      currByte = data[i + count];
      isHexChar = checkIfHexChar(currByte);
      while (isHexChar)
      {
        result[count++] = currByte;
        if (count == 64)
        {
          found = 1;
          break;
        }
        currByte = data[i + count];
        isHexChar = checkIfHexChar(currByte);
      }
      if (found)
        break;
    }
  }
  // printf("result: %s\n",result);
  return result;
}

